function loadJSByHeader(filename) {
    var eJS = document.createElement('script');
    eJS.setAttribute("type", "text/javascript");
    eJS.setAttribute("src", filename);
    document.getElementsByTagName("head")[0].appendChild(eJS);
}

function loadJSFile(filename) {

    document.write(getScrContent(filename));
}

function getScrContent(filename) {
    return '<' + 'script  src="' + filename + '"' +
    ' type="text/javascript"  "><' + '/script>'
}

var getBrowserName = function () {
    var name = "";
    var userAgent = navigator.userAgent.toLowerCase();
    if (userAgent.indexOf("opera") != -1) {
        name = "opera";
    } else {
        if (userAgent.indexOf("msie") != -1) {
            name = "msie";
        } else {
            if (userAgent.indexOf("safari") != -1) {
                name = "safari";
            } else {
                if (userAgent.indexOf("mozilla") != -1) {
                    if (userAgent.indexOf("firefox") != -1) {
                        name = "firefox";
                    } else {
                        name = "mozilla";
                    }
                }
            }
        }
    }

    return name;
}

var isIEBrowser = function () {
    return (getBrowserName() == "msie")
}

if (typeof gMapApiUrl == 'undefined') {
    gMapApiUrl = "/VTMapWeb/js/Package/Encrypt/GMapAPI.js";
}

if (typeof isMapAPIDynamicLoad == 'undefined') {
    isMapAPIDynamicLoad = false;
}

var isIE = isIEBrowser();
if (isIE || isMapAPIDynamicLoad) {
    loadJSByHeader(gMapApiUrl);
    loadScript();

}
else {
    loadJSFile(getGAPILink(isIE));
    loadJSFile(gMapApiUrl);

}

var initGMap = function () {
    if (typeof google != 'undefined' && typeof google.maps.OverlayView != 'undefined') {
        loadGMapAPI();
    }
    else {
        setTimeout(initGMap, 50);
    }
};

var triggerLoadedMap = function (_callback) {
    if (typeof viettel.MapAPIType != 'undefined' && viettel.MapAPIType == "GMap") {
        _callback()
    } else {
        setTimeout(function () {
            triggerLoadedMap(_callback)
        }, 15);
    }
};
